$(window).on('load',function(){
    setTimeout(function(){
        $('template').each(function(){
            var $t = $(this),
                toId = $t.attr('data-forid'),
                inHtml = $t.html(),
                $box = $('#'+ toId);

            if ($box.length){
                $box.html(inHtml)
            }
        })
    },50)
})


$(function(){
	function wowstart() {
		if(window.innerWidth>992) {
			new WOW().init();
		}
	}
	wowstart();
	var timer = false;
	var windowW= window.innerWidth ;
	$(window).on('resize',function(e){
		if ( windowW!= window.innerWidth ) {
			if (timer !== false) {
				clearTimeout(timer);
			}
			timer = setTimeout(function() {
				wowstart();
			}, 200);
			windowW= window.innerWidth ;
		}
	});
});
