$(function () {
	$("[href^='#']:not(.c-modal)" + "[href!='#']").on('click',function(){
		var headerH = $('.ge-header').height();
		var messageH = $('.ge-header-fixedMessage').height();
		var headerHight = headerH + messageH;
		var href= $(this).attr("href");
		var target = $(href == "#" || href == "" ? 'html' : href);
		var position = target.offset().top - headerHight;
		$("html, body").animate({scrollTop:position}, 550, "swing");
		return false;
	});
});


/* `TOP` */
var scroll_func = function (top) {
	if(top=="top"){
		$('html,body').scrollTop(800).stop().animate({ scrollTop: 0 }, 'slow','easeOutQuart');
	}else{
		$('html,body').animate({ scrollTop: $($(this).attr("href")).offset().top }, 'slow','easeOutQuart');
	}
	return false;
}
