var loading_func = function(mode){
	if(mode=='on'){
		$('.modLoading').remove();
		$('body').append('<div class="modLoading"><i class="fa fa-spinner fa-spin"></i></div>');
	}
	if(mode=='off'){
		$('.modLoading').fadeOut(function(){
			$(this).remove();
		});
	}
}

