$(function(){
	$(document).on('load scroll',function(){
		if($('.synactif-fixedNavi').length) {
			var scroll = $(window).scrollTop();
			if (scroll >= 1) {
				$('.synactif-fixedNavi').show();
			} else {
				$('.synactif-fixedNavi').hide();
			}
		}
	});
	$('.synactif-fixedNavi-list-item-dropdown-toggle').on('click',function(){
		if($(this).parent('.synactif-fixedNavi-list-item-text').next('.synactif-fixedNavi-list-item-dropdown').is(':hidden')){
			$(this).addClass('is-active');
			$(this).parent('.synactif-fixedNavi-list-item-text').next('.synactif-fixedNavi-list-item-dropdown').slideDown();
		} else {
			$(this).removeClass('is-active');
			$(this).parent('.synactif-fixedNavi-list-item-text').next('.synactif-fixedNavi-list-item-dropdown').slideUp();
		}
		return false;
	});
	$('.synactif-fixedNavi-toggle a').on('click',function(){
		if($(this).closest('.synactif-fixedNavi').find('.synactif-fixedNavi-list').is(':hidden')) {
			$(this).closest('.synactif-fixedNavi').find('.synactif-fixedNavi-list').slideDown();
		} else {
			$(this).closest('.synactif-fixedNavi').find('.synactif-fixedNavi-list').slideUp();
		}
		return false;
	});
	$(document).on('click',function(e){
		if(!$(event.target).closest('.synactif-fixedNavi').length && window.innerWidth<992) {
			$('.synactif-fixedNavi-list').fadeOut();
		}
	});
})
